import React from 'react';
import classes from './CardProjet.module.css';
const CardProjet=(props)=> {
    return (
        <div>
            <h3>{props.title}</h3>
            <div>
            <img src={props.img}/>
            </div>
            <a>Voir Code</a>
        </div>
    );
}

export default CardProjet;
